¬†
Question first: What is the green thing that divides this anemone? Is it coral? Is it a sponge? I will edit this and tag you for the help.
¬†
The Giant Caribbean Sea Anemone or Condylactis gigantea are usually found in crevices, or attached to a rock or shells, or almost any other hard object in shallow water.  They have been found down to 30k feet. The outside diameter of these anemones can reach 16 inches.
¬†
Anemones seem to be stationary but they are actually mobile.¬† They slowly crawl by use of its pedal disc (thing that attaches it to the hard surface). This movement is not used in defense.¬† Anemones use nematocysts for defense. Nematocysts are stinging cells found mostly at the tips of their tentacles.¬† These nematocysts contain CgNa toxin.¬† When stimulated, the nematocysts explode out of their capsule and 'impale' the attacker and the toxin is discharged causing pain and or paralysis. Anemone stings are not usually fatal to humans, but if there is an allergic reaction, you probably should call your local EMS. (Post not to be used as medical advice)
¬†
Guest appearance - Lettuce Coral
¬†
Agaricia tenuifolia (was Undaria tenuifolia) are a tannish color coral where the colonies are either encrusting a surface or forming a complex of horizontal blades.¬† It seems that Lettuce Coral can be found down to about 75 meters, but the deeper you find them, the flatter they form.¬† Blades tend to form at the shallower depths.
¬†
Because anemones don't move quickly, they are easy to photograph (and they just plain look cool). The next couple posts will be dedicated to the Anemones encountered on this last trip to Cozumel.

